pub fn deinit(self: *LowerMap) void {
    self.map.deinit();
    if (singleton) |*s| {
        s.ref_count -= 1;
        if (s.ref_count == 0) {
            self.allocator.destroy(s.instance);
            singleton = null;
        }
    }
}

/// toLower maps the code point to the desired case or returns the same code point if no mapping exists.
pub fn toLower(self: LowerMap, cp: u21) u21 {
    return if (self.map.get(cp)) |mcp| mcp else cp;
}
